def common_elements(arr1, arr2):
    if len(arr1) == 0 or len(arr2) == 0:
        return []

    # Sort both arrays
    arr1 = sorted(arr1)
    arr2 = sorted(arr2)

    # Find the first element that is not present in either array
    i = 0
    while i < len(arr1) and i < len(arr2):
        if arr1[i] != arr2[i]:
            break

        i += 1

    # If we found an element, then it's the only one
    if i >= len(arr1) and i >= len(arr2):
        return [arr1[i]]

    # Otherwise, there are more than one common element
    else:
        return [arr1[i], arr2[i]]
